import classes from './Description.module.css';

const Description = () => {
  return (
    <div className={classes.description}>
      <div className={classes.description_info}>Mô tả</div>
      <div className={classes.info}>Thông tin bổ sung</div>
    </div>
  );
};

export default Description;
